import logo from './pluginIcon.png';
import './App.css';
import React from 'react';
import { useState, useEffect } from 'react';


function App() {

  const [txtData, setTxtData] = useState("En cours de chargement...");


  useEffect(() => {
    fetch(process.env.PUBLIC_URL + "/input.txt")
    .then(r => r.text())
    .then(text => {
      setTxtData(text.split("\n"))
    });
  }, [])

  let s = txtData;
  let txtArray = s.split("\n");
  //console.log(txtArray);
  //console.log(txtArray.length);

  let i = 0;

  while (i < txtArray.length) {
      console.log(txtArray[i]);
      i++;
  }
  //s.split(" ").forEach(character => console.log(character));

   return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code>adventofcode.com/2023</code> 
        </p>
        <a
          className="App-link"
          href="https://adventofcode.com/2023/day/1"
          target="_blank"
          rel="noopener noreferrer"
        >
          Day 1: Trebuchet?!
        </a>
      </header>
      <div className="App-body">
        <div  className="display-linebreak">
          {txtArray}
        </div>
      </div>
    </div>
  );
}

export default App;
